const defaultAreEqual = (args, pArgs) => args[0] === pArgs[0] && args[1] === pArgs[1] && args[2] === pArgs[2] && args[3] === pArgs[3];

const memoOne = (fn, areEqual) => {
  const equal = areEqual || defaultAreEqual;
  let args = [],
      value;
  return function () {
    if (equal(arguments, args)) return value;
    args = arguments;
    value = fn.apply(this, args);
    return value;
  };
};

export default memoOne;
